    employs one full time employee, the Executive Director, whose time was less than
    25 percent devoted to federal elections and candidates during this reporting period.
    \ No other entity pays compensation for their employees to work for the Committee.
    The Committee does not engage in any fundraising on behalf of candidates for Federal
    office, so all of its reported fundraising expenses are party fundraising. The
    Committee maintains both Federal and Non Federal accounts.  This is the last report
    the Committee will file using the monthly reporting schedule this year, because
    the Committee will not be engaging in Federal Election Activity in 2011.  The
    Committee will file a semi-annual report covering the period February 1 to June
    30 in July 2011.   The original report used the wrong percentage for allocable
    administrative expenses (15%-85% rather than 36%-64%), and a previous amendment
    attempted to correct that problem.  However, I recently discovered that the first
    amendment did not in fact correct the problem.  This second amendment uses the
    correct 36%-64% split.   \n"
